import React from "react"
import Square from "./Square";
import './board.css'
function Board (props) {
  return (
    <div className="board">
      <Square id={0} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={1} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={2} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={3} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={3} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={4} getPlayer={props.getPlayer}  boardMove={props.boardMove}/>
      <Square id={5} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={6} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={7} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
      <Square id={8} getPlayer={props.getPlayer} boardMove={props.boardMove}/>
    </div>
  )
};

export default Board;
